import Header from "./components/header";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Dashboard from './pages/dashboard';



function App() {
	return (
		<Router>
			<Dashboard>
				<Switch>
					<Route path="/" exact>
						<Header/>
					</Route>
				</Switch>
			</Dashboard>
		</Router>
	);
}
export default App;
